//Get Locations & Zones
export const GET_LOCATIONS                              =   'GET_LOCATIONS';
export const GET_LOCATIONS_SUCCESS                      =   'GET_LOCATIONS_SUCCESS';
export const GET_LOCATIONS_ERROR                        =   'GET_LOCATIONS_ERROR';

//Create Task
export const CREATE_TASK                                =   'CREATE_TASK';
export const CREATE_TASK_SUCCESS                        =   'CREATE_TASK_SUCCESS';
export const CREATE_TASK_ERROR                          =   'CREATE_TASK_ERROR';

//Edit Task
export const EDIT_TASK                                  =   'EDIT_TASK';
export const EDIT_TASK_SUCCESS                          =   'EDIT_TASK_SUCCESS';
export const EDIT_TASK_ERROR                            =   'EDIT_TASK_ERROR';

//Task Details
export const GET_TASK_DETAILS                           =   'GET_TASK_DETAILS';
export const GET_TASK_DETAILS_SUCCESS                   =   'GET_TASK_DETAILS_SUCCESS';
export const GET_TASK_DETAILS_ERROR                     =   'GET_TASK_DETAILS_ERROR';

//Track Details
export const GET_TRACK_DETAILS                          =   'GET_TRACK_DETAILS';
export const GET_TRACK_DETAILS_SUCCESS                  =   'GET_TRACK_DETAILS_SUCCESS';
export const GET_TRACK_DETAILS_ERROR                    =   'GET_TRACK_DETAILS_ERROR';

//Delete Task
export const DELETE_TASK                                =   'DELETE_TASK';
export const DELETE_TASK_SUCCESS                        =   'DELETE_TASK_SUCCESS';
export const DELETE_TASK_ERROR                          =   'DELETE_TASK_ERROR';

//Update Task Status
export const UPDATE_TASK_STATUS                         =   'UPDATE_TASK_STATUS';
export const UPDATE_TASK_STATUS_SUCCESS                 =   'UPDATE_TASK_STATUS_SUCCESS';
export const UPDATE_TASK_STATUS_ERROR                   =   'UPDATE_TASK_STATUS_ERROR';

//Search
export const RESET_TASK_SEARCH                          =   'RESET_TASK_SEARCH';
export const TASK_SEARCH                                =   'TASK_SEARCH';
export const TASK_SEARCH_SUCCESS                        =   'TASK_SEARCH_SUCCESS';
export const TASK_SEARCH_ERROR                          =   'TASK_SEARCH_ERROR';

//Shopped Late
export const GET_SHOPPEDLATE                            =   'GET_SHOPPEDLATE';
export const GET_SHOPPEDLATE_SUCCESS                    =   'GET_SHOPPEDLATE_SUCCESS';
export const GET_SHOPPEDLATE_ERROR                      =   'GET_SHOPPEDLATE_ERROR';

//Update Filter
export const UPDATE_FILTER                              =   'UPDATE_FILTER';
